import React from "react";
import 'bootstrap/dist/css/'
import { Container, Row, Col, Card } from "react-bootstrap";

const App = () => {
  return (
    <Container>
      <Row>
        <Col xs={4}>
          <Card>Offre utlisee</Card>
        </Col>
        <Col>
          <p>Essayez une autre offre</p>
        </Col>
      </Row>
    </Container>
  );
};

export default App;
